pub fn max_points(grid: Vec<Vec<i32>>, queries: Vec<i32>) -> Vec<i32> {
    let length = queries.len();
    let mut sorted_queries = queries.into_iter().enumerate().collect::<Vec<(usize, i32)>>();
    sorted_queries.sort_by_key(|x| x.1);

    let width = grid[0].len() as i32;
    let height = grid.len() as i32;

    let mut heap: BinaryHeap<Reverse<(i32, (usize, usize))>> = BinaryHeap::from([Reverse((grid[0][0], (0, 0)))]);
    let mut traversed = vec![vec![false; width as usize]; height as usize];
    traversed[0][0] = true;

    let mut result = vec![0; length];
    let mut running = 0;
    'outer: for q in sorted_queries {
        loop {
            if heap.is_empty() {
                result[q.0] = running;

                continue 'outer;
            }

            if heap.peek().unwrap().0.0 >= q.1 {
                result[q.0] = running;

                continue 'outer;
            }

            let current = heap.pop().unwrap().0;
            running += 1;

            let p = (current.1.0 as i32, current.1.1 as i32);
            for n in [
                (p.0, p.1 + 1),
                (p.0 + 1, p.1),
                (p.0, p.1 - 1),
                (p.0 - 1, p.1),
            ] {
                if (n.0 < 0) || (n.0 >= width) || (n.1 < 0) || (n.1 >= height) {
                    continue;
                }

                let candidate = (n.0 as usize, n.1 as usize);

                if traversed[candidate.1][candidate.0] {
                    continue;
                }

                traversed[candidate.1][candidate.0] = true;

                heap.push(Reverse((grid[candidate.1][candidate.0], candidate)));
            }
        }
    }

    result
}